 import React, { useState } from "react";
 import { GoogleMap } from "@google/maps";
const Map = () => {
 const [zoom, setZoom] = useState(15);
const [center, setCenter] = useState({
    lat: 37.775,
    lng: -122.418,
  });
  
  return (
    <>
        
 <GoogleMap
        center={center}
        zoom={zoom}
        onZoomChanged={setZoom}
        onCenterChanged={setCenter}
      />

    </>
  )
}

export default Map





















